import React from 'react';
import './Navbar.css';


function Nav() {
  return (
    <div>
        <div className='navbar'>
        
           <ul>
            <li>&#32;&#32;&#32;&#32;&#32;&#32;</li>

            <a href="/"><li>Resturant</li></a>
            <a href="/Kids"><li>Kids</li></a>
            <a href="/"><li>Tech</li></a>
            <a href="#"><li>Food</li></a>
            <a href="#"><li>Home</li></a>
            </ul> 
            
            
            
        </div>
        
        
    </div>
  );
}

export default Nav;
